import React from 'react'
import {Divider, Drawer, Grid, ListItem, ListItemIcon, ListItemText, makeStyles} from '@material-ui/core'
import { Link } from 'react-router-dom'
import { Close } from '@material-ui/icons'

const styles = makeStyles({
    root:{
        marginTop: '3vh'
        // display:'flex',
        // flexDirection:'column',
        // padding: '1vw'
    }
})

interface IProps{
    open: boolean
    handleClose: () => void
}

const SideMenu: React.FC<IProps> = (props) =>{

    const {open, handleClose} = props
    const useStyle = styles()

    return(
        // <Drawer
        //     anchor='left'
        //     open = {true}
        //     onClose={handleClose}>
            <Grid
                className={useStyle.root}
                container>
                <ListItem>
                    <ListItemIcon>
                        <Close/>
                    </ListItemIcon>
                    {open &&(
                    <ListItemText>
                        <Link to='/'>Back</Link>
                    </ListItemText>
                    )}
                </ListItem>
                <ListItem>
                    <ListItemIcon>
                        <Close/>
                    </ListItemIcon>
                    {open && (
                    <ListItemText>
                        <Link to='/1'>To</Link>
                    </ListItemText>
                    )}
                </ListItem>
            </Grid>
        // </Drawer>
    )
}

export default SideMenu;
